import React, { Component } from "react";

class UserPortal extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div className="container-fluid main-container">
        <div className="container user-container">
            <h6 className="user-info-text">User Information</h6>
            <h6 className="d-inline-block mb-1 titles-text">Name</h6>

            <h6 id="wallet" className="d-inline-block mb-1 titles-text">Wallet</h6>

        </div>
        <div className="container-fluid holdings-container"></div>
        <div className="conatiner-fluid browse-container"></div>
      </div>
    );
  }
}

export default UserPortal;
